:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  WILLIAMS, Edward Marsh and DAVIS, Jane
  WILLIAMS, Allen Marsh and BUCHANAN, Annabelle Milne (Bella)
  JWILLIAMS, Edward Gordon and EMPSON, Judith Mary
  JWILLIAMS, David Empson and ELWORTHY, Josephine
  01> WILLIAMS, David Empson m on 24.04.1934 to (1)ELWORTHY, Josephine
  b 06.05.1910 d 07.12.1977
  b ** ** **** d 27.08.1940
  Josephine, d/o Herbert Elworthy and Gladys Cleveland, b. at Timaru.
  David was educated at Hurworth School and Wanganui Collegiate School. He served in the Special Force
  commando unit in the Pacific in WW2 and was awarded the United States Silver Star and the MC. He
  farmed at "Drumpeel" near Otane and served as President of the New Zealand Produce Growers' Board. He
  retired in the 1960's to Turangi where he was a prison counsellor. He developed a fine garden
  containing many specimen trees and rhododendrons.
  Josephine was educated at Amberley House.
  01> WILLIAMS, Nicola Mary m on ** **.1958 to GRIMMOND, Barry Betham
  b 15.09.1936
  b 24.05.1931
  Nicola b. at Hastings and m. at Dunedin. Divorced. Barry, s/o Thomas Parr Grimmond and Olive
  Edwards. Address: PO Box 6103, Dunedin; Email: nicola.grimmond@stonebow.otago.ac.nz.
  Nicola was educated at St Matthews Collegiate School, Masterton, Auckland University College (BSc)
  and University of Otago (MSc). Now retired, she was a senior lecturer and zoologist at the
  University of Otago. She served four terms on the University of Otago Council, was Chairperson of
  the University College Council and was Co-ordinator of Student Services for 14 years. Currently
  she does conflict resolution work as a consultant and mediator. She lives at Warrington, just
  north of Dunedin, on a beautiful beach.
  01> GRIMMOND, Christine Susan and SOUCH, Catherine Jane
  Betham
  b 16.02.1959
  b 12.04.1961
  Susan b. at Dunedin. Catherine, d/o Francis Arthur Souch and Susan Winifred John, b. at
  Cambridge, UK. Address: 1810 Southdowns Drive, Bloomington, Indiana, USA.
  Susan was educated at St Hilda's Collegiate School, Dunedin, St Matthews Collegiate School,
  Masterton, Otago University (BSc (Hons)) and University of British Columbia (MSc, PhD). She is
  an Associate Professor and Geographer at Indiana University and specialises in climatology.
  Her research is funded by the US National Science Foundation and the US Departments of
  Agriculture, Forest Service and Energy. She has research projects in seven cities in Canada,
  USA and Mexico. She is co-chairperson of the International Society of Biometeorology and a
  member of the NSF Geography and Regional Science Award Panel.
  Catherine has a BA(Cambridge), MSc and PhD (University of British Columbia) and is Associate
  Professor of Geography at Indiana University and Purdue University (IUPUI) in Indianapolis,
  USA.
  02> GRIMMOND, David Michael m on 29.12.1992 to DELAHUNTY, Adrienne
  Betham
  Jane
  b 27.08.1961
  b 09.09.1961
  David b. at Dunedin. Adrienne, d/o Denis Delahunty and Ita O'Kane. Address: 66 Overtoun
  Terrace, Hataitai, Wellington.
  David was educated at John McGlashen College, Dunedin, Wanganui Collegiate School and graduated
  BA(Hons) in Economics from Otago University in 1982. He worked in London for four years and
  was then a research economist and forecaster with the New Zealand Institute of Economic
  Research. He was a macroeconomist and manager for the New Zealand Treasury and is now a senior
  economist with Infometrics
  Adrienne is the Information Officer with the NZ Association of Citizens Advice Bureaus.
  David plays football and tennis and is a keen long-distance cyclist. He and Adrienne both
  participate in triathlon and duathlon events.
  01> GRIMMOND, Che Isaac Delahunty
  b 29.12.1997
  Che b. at Wellington.
